import Loader from './components/loader';
import './App.css';
import logoName from './img/BULLDEV-logo .png'

function App() {
  return (
    <>
      <header>
        <nav>
          <div className="logo">
            <img src={logoName}/>
          </div>
        </nav>
      </header>

    </>
  );
}

export default App;
